<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Barometer</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Gabriela&family=PT+Sans:ital@0;1&display=swap" rel="stylesheet">
    @vite(['resources/sass/app.scss', 'resources/js/app.js'])

</head>
<body>
    <nav>
        <div class="logo-box">
            <svg class="logo">
                <use xlink:href="#barometer"></use>
            </svg>
        </div>
        <div class="controls controls--js">
            <div class="nav--vilnius">Vilnius</div>
            <div class="nav--nida">Nida</div>
            <div class="nav--both">Both</div>
        </div>
    </nav>
    <main>
    <div class="message message--js" data-update-condition="{{$lastUpdate}}"></div>
        <h1>Current weather conditions</h1>
        <div class="both-cities-box both--js">
         {{-- TEST @if(isset($notExistingVariable)) --}}
            @if(isset($barometerData))
            @forelse($barometerData as $oneCity)
            <div class="one-city {{$oneCity['city']}}--city">
                <h2>{{$oneCity['city']}}</h2>
                <div class="weather-pressure-box">
                    <div class="city-weather weather--{{$oneCity['city']}}" data-weather-condition="{{$oneCity['weather_condition']}}">
                        <svg class="weather-svg">
                            <use xlink:href="#{{$oneCity['weather_condition']}}"></use>
                        </svg>
                        <span class="weather-name"></span>
                    </div>
                    @if($oneCity['is_rising'] !== null)
                    {{-- TEST <div class="pressure-box is--rising--{{$oneCity['city']}}" data-is-rising="1"> --}}
                    <div class="pressure-box is--rising--{{$oneCity['city']}}" data-is-rising="{{$oneCity['is_rising']}}">
                        <svg class="arrow-svg">
                            <use xlink:href="#arrow"></use>
                        </svg>
                        <span class="pressure-condition"></span>
                    </div>
                    @else
                    <div class="pressure-else">Pardon, information about barometric pressure changes is not available at this time.</div>
                    @endif
                </div>
                <div class="barometer-box {{$oneCity['city']}}--barometer" data-pressure={{$oneCity['pressure']}}>
                    <img class="barometer-img" src={{asset('barometer.png')}}>
                    <div class="barometer-arrow-box">
                        <svg class="barometer-arrow">
                            <use xlink:href="#arrow"></use>
                        </svg>
                    </div>
                </div>
            </div>
            @empty
            <div class="no-data no--data">
                <svg>
                    <use xlink:href="#sloth"></use>
                </svg>
                <div>Pardon, no data.</div>
            </div>
            @endforelse
            @else
            <div class="no-data no--data">
                <svg>
                    <use xlink:href="#sloth"></use>
                </svg>
                <div>Pardon, no data.</div>
            </div>
            @endif
        </div>
    </main>
    <footer>
        <div>&copy; Rugilė Stasionytė</div>
        <a href="https://rugile.website/">https://rugile.website/</a>
        <div class="github-ico-box">
            <span>See code:</span>
            <a href="https://github.com/kauste/barometer-app" target="_blank">
                <svg class="github-ico">
                    <use xlink:href="#github"></use>
                </svg>
            </a>
        </div>
    </footer>
</body>
